The main temple is a stupa built in three tiers around a hill which was a natural centre: a pyramidal base with five concentric square terraces, the trunk of a cone with three circular platforms and, at the top, a monumental stupa. The walls and balustrades are decorated with fine low reliefs.

The vertical division of Borobudur Temple into base, body, and superstructure perfectly accords with the conception of the Universe in Buddhist cosmology. 

